          //onPress={() => handleLike(post)}
            // source={{
            //   uri: post.likes_by_users.includes(firebase.auth().currentUser.email)
            //     ? postFooterIcons[0].likedImageUrl
            //     : postFooterIcons[0].imageUrl,
            // }}
